// ComicSansfy

(function () {
    var lastStyle = document.styleSheets[document.styleSheets.length - 1];
    lastStyle.insertRule('* {font-family: "Comic Sans MS" !important;}', lastStyle.cssRules.length);
    
    var ribbon = document.createElement('img');
    ribbon.src= 'data:image/png;base64,';
    ribbon.style.border = '0';
    ribbon.style.zIndex = '100';
    ribbon.style.position='absolute';
    ribbon.style.top='0'; 
    ribbon.style.right='0';
    document.body.appendChild(ribbon);
})();


